  type: Class
  assemblies:
  - SoCore
  namespace: SuperOffice.Threading
  summary: Base class for implementing a processor working on chunks of a queue.
  remarks: >-
    The processor is designed to be used with AsyncChunkedProcessedQueue and 

    will dirrectly be used by QueueaAsyncChunkHandler.  Implementers of the 

    processor needs to implement the method <xref href="SuperOffice.Threading.QueueAsyncChunkProcessor%601.ExecuteWorkOnWorkItem(%600)" data-throw-if-not-resolved="false"></xref> to process

    each induvidual item in the queue.  All implementations need a default parameter-less

    constructor.
  example: []
  syntax:
    content: 'public abstract class QueueAsyncChunkProcessor<TWorkItem> : AsynchronousHandlerProcessor<Queue<TWorkItem>>'
    typeParameters:
    - id: TWorkItem
      description: The type that is in the queue
    content.vb: Public MustInherit Class QueueAsyncChunkProcessor(Of TWorkItem) Inherits AsynchronousHandlerProcessor(Of Queue(Of TWorkItem))
